cartaParaPdf.PdfMaker = function () {
  var docDefinition = {
    content: [],
    defaultStyle: {
      font: 'OpenSans'
    },
    pageBreakBefore: function (currentNode, followingNodesOnPage, nodesOnNextPage, previousNodesOnPage) {
      var twoPageParagraphs = currentNode.headlineLevel === 2 && currentNode.pageNumbers.length === 2;
      var titleFollowedByTwoPagesParagraph = currentNode.headlineLevel === 1 && followingNodesOnPage[0].pageNumbers.length === 2;

      return titleFollowedByTwoPagesParagraph || twoPageParagraphs;
    },
    footer: function (currentPage, pageCount) {
      return {
        columns: currentPage !== 1 ? [currentPage.toString()] : [''],
        color: '#606060',
        margin: [513, 20, 70, 0],
        bold: true,
        fontSize: 10
      };
    },
    header: function (currentPage, pageCount) {
      return {
        columns: currentPage === 1 ? ['__________________________________________________________________'] : [''],
        color: '#2C66CE',
        background: '#2C66CE',
        margin: [0, 0, 0, 0],
        bold: true,
        fontSize: 26
      };
    },
    pageSize: 'A4',
    pageMargins: [70, 70],
    pageOrientation: 'portrait',
    styles: {
      title: {
        fontSize: 55,
        bold: true,
        color: '#2C66CE',
        lineHeight: 0.7,
        margin: [0, 60, 0, 0]
      },
      code: {
        fontSize: 12,
        color: '#606060',
        margin: [0, 0, 0, 5],
        italics: true
      },
      text: {
        fontSize: 12,
        color: '#606060',
        margin: [0, 0, 0, 5]
      },
      border: {
        fontSize: 30,
        color: '#dddddd',
        lineHeight: 0.64
      },
      subtitle: {
        fontSize: 25,
        bold: true,
        color: '#606060',
        lineHeight: 0.8
      },
      header: {
        fontSize: 32,
        bold: true,
        color: '#2C66CE',
        lineHeight: 0.8,
        margin: [0, 40, 0, 30]
      },
      subheader: {
        fontSize: 22,
        bold: true,
        color: '#606060',
        lineHeight: 0.8,
        margin: [0, 0, 0, 7]
      },
      subheadermargin: {
        fontSize: 22,
        bold: true,
        color: '#606060',
        lineHeight: 0.8,
        margin: [0, 90, 0, 7]
      },
      thirdheader: {
        fontSize: 15,
        italics: true,
        color: '#606060',
      },
      thirdheaderTable: {
        fontSize: 12,
        italics: true,
        margin: [0, 0, 0, 5],
        color: '#606060'
      },
      tableExample: {
        margin: [0, 5, 0, 15],
        color: '#606060'
      },
      list: {
        fontSize: 12,
        blod: true,
        color: '#606060',
        margin: [10, 0, 0, 0]
      },
      listMargin: {
        fontSize: 12,
        blod: true,
        color: '#606060',
        margin: [10, 0, 0, 0]
      },
      paragraph: {
        fontSize: 12,
        color: '#606060',
        margin: [0, 0, 0, 15]
      }
    }
  };

  pdfMake.fonts = {
    OpenSans: {
      normal: 'OpenSans-Regular.ttf',
      italics: 'OpenSans-BoldItalic.ttf',
      bold: 'OpenSans-ExtraBold.ttf'
    }
  };

  function initialDocDefinition(nome) {
    var output = [];
    output.push({
      text: nome,
      style: 'title'
    });
    output.push({
      text: '__________________________________',
      style: 'border',
      margin: [0, 30, 0, 0]
    });
    output.push('\n');
    output.push('\n');
    output.push({
      text: 'Carta de Serviços',
      style: 'subtitle',
      margin: [0, 20, 0, 0]
    });
    output.push({
      margin: [0, 10, 0, 0],
      fontSize: 11,
      text: 'Documento gerado em ' + new cartaParaPdf.FormatterHelper().getCurrentDate(),
      fontStyle: 50,
      style: 'paragraph'
    });
    output.push('\n');
    output.push('\n');
    output.push({
      text: 'A Carta de Serviços é um instrumento de gestão pública, que contém informações sobre os serviços públicos prestados de forma direta ou indireta pelos órgãos e entidades da administração pública.',
      style: 'paragraph'
    });
    output.push({
      text: 'Ela contempla as formas de acesso, padrões de qualidade e compromissos de atendimento aos usuários.',
      style: 'paragraph'
    });
    output.push({
      width: 120,
      margin: [-37, 30, 0, 0],
      image: 'data:image/jpeg;base64,'
    });

    return output;

  }

  function capaOrgao(orgao) {
    var output = [];
    var parseHtml = new cartaParaPdf.ParseHtml();
    var parser = parseHtml.parseHtml;
    var descricaoObject = [];
    var contatoObject = [];
    parser(descricaoObject, markdown.toHTML(orgao.descricao));
    parser(contatoObject, markdown.toHTML(orgao.contato), true);

    output.push({
      text: orgao.nome,
      style: 'header'
    });
    output.push({
      text: 'Quem somos?',
      style: 'subheadermargin'
    });
    output.push('\n');
    output.push(descricaoObject);
    output.push();
    if (orgao.contato) {
      output.push({
        text: 'Contato',
        style: 'subheadermargin'
      });
      output.push('\n');
      output.push(contatoObject);
      output.push({
        text: '',
        style: 'paragraph'
      });
    }
    output.push({
      text: '',
      style: 'paragraph'
    });

    return output;
  }

  function geraInformacoesDosServicos(servicos) {
    var output = [];

    $(servicos).each(function (index, xml) {
      output.push(geraInformacoesDoServico(xml));
    });

    return output;
  }

  function geraInformacoesDoServico(xml) {
    var servicoParser = new cartaParaPdf.ServicoParser();
    var servicoObject = servicoParser.parseXml(xml);
    var contentBuilder = new cartaParaPdf.ContentBuilder(servicoObject);

    return contentBuilder.buildContent();
  }

  function indice(servicos, orgaoNome, sumario) {
    var nomesServicos = [];
    var servicoParser = new cartaParaPdf.ServicoParser();
    var output = [];
    var actualPage = 0;

    if (sumario) {
      actualPage = sumario[0] + sumario[1] + sumario[2] + 1;
    }

    $(servicos).each(function (index, xml) {
      var servicoObject = servicoParser.parseXml(xml);
      if (sumario) {
        nomesServicos.push(servicoObject.nome + ' - página ' + actualPage);
        actualPage += sumario[index + 3];
      } else {
        nomesServicos.push(servicoObject.nome);
      }
    });

    output.push({
      text: orgaoNome,
      style: 'header'
    });
    output.push('\n');
    output.push({
      text: 'Serviços disponíveis',
      style: 'subheadermargin'
    });
    output.push('\n');
    output.push({
      ul: nomesServicos,
      style: 'list'
    });

    return output;
  }

  function countPages(section, callback) {
    var tempDoc = docDefinition;

    tempDoc.content = section;
    var pdf = pdfMake.createPdf(tempDoc);

    pdf._getPages({}, function (pages) {
      callback(null, pages.length);
    });
  }

  function geraPdf(xmlOrgao, xmlServicos) {
    var orgaoParser = new cartaParaPdf.OrgaoParser();
    var orgao = orgaoParser.parseXml(xmlOrgao);
    var doc = initialDocDefinition(orgao.nome);
    var capa = capaOrgao(orgao);
    var sumario = indice(xmlServicos, orgao.nome);
    var servicos = geraInformacoesDosServicos(xmlServicos, orgao.nome);
    var docs = [doc, capa, sumario].concat(servicos);

    async.map(docs, countPages, function (err, results) {
      var newServicos = [];

      sumario = indice(xmlServicos, orgao.nome, results);
      $(servicos).each(function (index, value) {
        newServicos.push([{
          text: '',
          pageBreak: 'after'
        }]);
        newServicos = newServicos.concat(value);
      });

      docDefinition.content = [
				doc,
        {
          text: '',
          pageBreak: 'after'
        },
				capa,
        {
          text: '',
          pageBreak: 'after'
        },
				sumario,
				newServicos
			];

      pdfMake.createPdf(docDefinition).download('cartadeservicos_' + orgao.nome.toLowerCase().replace(/ /g, ''));
    });
  }

  return {
    geraPdf: geraPdf,
    initialDocDefinition: initialDocDefinition,
    docDefinition: docDefinition,
    capaOrgao: capaOrgao,
    geraInformacoesDosServicos: geraInformacoesDosServicos
  };
};
